/** @format */

const DogList = ({ dogs }) => {
  console.log(dogs);
  return (
    <div>
      <h1>Dog List</h1>
      <ul>
        {dogs.map((m) => {
          return (
            <li style={{ border: "dashed" }}>
              <p>Name: {m.name}</p>
              <p>Age: {m.age}</p>
              <img src={m.src} alt={m.name}></img>
              <ul>
                <h4>Facts: </h4>
                {m.facts.map((f) => {
                  return <li>{f}</li>;
                })}
              </ul>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default DogList;
